/* Navbar.js */

import React from 'react'
import {Nav, NavbarContainer, NavLogo} from './NavbarElements';

const Navbar = () => {
    return (
        <>
            <Nav>
                <NavbarContainer>
                    <NavLogo to="/">
                        gameWithFriends
                    </NavLogo>
                    <h1>Hi</h1>
                </NavbarContainer>
            </Nav>
        </>
    )
}

export default Navbar
